import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import SignIn from "./SignIn/SignIn";
import "./SignIn/SignIn.css";
import "./pages.css";
import NavBar from "./navbar/NavBar";
import logo from './logo.jpg';

class Home extends Component {
  constructor(props) {
    super();
    this.state = {};
  }

changeRoute = (newRoute) => {
  this.props.changeRoute(newRoute);
}
loadUser = (data) =>{
  this.props.loadUser(data);
}

  render() {
    return (
      <div>
        <NavBar changeRoute={this.changeRoute} />

        <div className="tc">
          <br />
          <br />
          <br />
          <h1 className="tc white i f1 font">Our name</h1>
          <br />
          <br />
          <Container>
            <Row>
           
              <Col className="tc f3 solidBR">
                  So what do we do?
               <hr />
                <div className="tl f3 i">
                  We have creates a simple yet powerful program to simplify 
                  anstrophysics. After stuggling through those PSETS, we 
                  decided there must be a better way. Now there is ... 
                  <br/>               
                </div>
              </Col>

                <Col className=''>
            
             <img src={logo} />
               </Col>
          

                      </Row>

              <br/>

              <br/>
              <br/>

              <Row>
           
              <Col className="tc f3 solidBR">
                  Struggling with Orbitals?

                <hr />
                <div className="tl f3 i">
                  Struggle with Orbitals? We got you. We can find
                  <br/>
                  - Velocity <br/>
                  - Gravitanal constant <br/>
                  - Mass of Large body <br/>
                  - Gravitanal constant <br/>
                  - Radius <br/>
                  - Average between aosis?? <br/>
                  <br/>               
                </div>
              </Col>

                <Col className=''>
            
             <img src={logo} />
               </Col>
          

                      </Row>

          </Container>
          <br/>
          <br/>
        </div>
      </div>
    );
  }
}

export default Home;
